import React from "react";
import { styled } from "@mui/material/styles";
import { APP_HEADER_HEIGHT } from "../../constants/app";
import homeScreenImage from "../../assets/home-screen.jpg";
import { Typography } from "@mui/material";

const HomeScreenEl = styled("div")(({ theme }) => ({
  height: `calc(100vh - ${APP_HEADER_HEIGHT}px)`,
  backgroundImage: `url(${homeScreenImage})`,
  backgroundSize: "cover",
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
}));

const HomeScreen = () => {
  return (
    <HomeScreenEl>
      <Typography variant="h1">Get weather data</Typography>
      <Typography variant="h3">Search by:</Typography>
      <Typography variant="h3">City name</Typography>
      <Typography variant="h3">
        Zip code <Typography variant="h6">Only for USA</Typography>
      </Typography>
    </HomeScreenEl>
  );
};

export default HomeScreen;
